import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <div class="container">
        <div class="home">  
          <h1>Math Riddles Online</h1>
          <button type="button" onclick="">Play</button>
          <button type="button" onclick="">Levels</button>
        </div>
      </div>
    </div>
  );
}

export default App;
